import React from 'react';

import axios from 'axios';

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    const config = {
        headers: { Authorization: `Bearer AAAAAAAAAAAAAAAAAAAAAOvwVgEAAAAA5c12yUYj7fM3D1tGnj%2FnQTAFj08%3DPnP4XWWpXZ1kb5FfIkjWSWFtzfLSxMqkAiMgoLgzhedJeteh6P` }
    };
    axios.get(`https://api.twitter.com/2/users/by/username/rashmibrao`,config)
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <ul>
        { this.state.persons.map(person => <li>{person.name}</li>)}
      </ul>
    )
  }
}
